import {aTypeGetCookieData, aTypeSetShowLoader, aTypeGetCookieCategories} from './ActionCreater';

let initialState = {
    cookieData: [],
    cookieCategories: [],
    isShowLoaderCount: 0
}

function globalDataReducer(state = initialState, action){
    switch(action.type){
        case aTypeGetCookieData:{
            console.log('get cookie');
            return {...state, cookieData: action.val};
        }
        case aTypeIncShowLoaderCount:{
            console.log('inc set loader');
            return {...state, isShowLoaderCount: ++state.isShowLoaderCount};
        }
        case aTypeDecShowLoaderCount:{
            console.log('dec set loader', action.val);
            return {...state, isShowLoaderCount: --state.isShowLoaderCount};
        }
        case aTypeGetCookieCategories:{
            console.log('get categ');
            return {...state, cookieCategories: action.val};
        }
        default:{
            return state;
        }
    }
}

export default globalDataReducer;
